  'AdminAdvparametersHelp' => 
  array (
    '-- Choose --' => '-- Pasirinkti --',
    'or' => 'arba',
    'Use this option to associate data (products, modules, etc.) the same way for each selected shop.' => 'Naudokite šią parinktį, norėdami susieti duomenis (prekes, modulius ir kt.) tokiu pačiu būdu kiekvienoje pasirinktoje parduotuvėje.',
    'Click here to display the shops in the %name% shop group' => 'Spauskite čia, jei norite matyti parduotuves, esančias %name% parduotuvių grupėje',
    'Click here to display the URLs of the %name% shop' => 'Spauskite čia, jei norite matyti visus %name% parduotuvės URL',
    'Click here to display the list of shop groups' => 'Spauskite čia, jei norite matyti parduotuvių grupių sąrašą',
    'Warning: Enabling the "share customers" and "share orders" options is not recommended. Once activated and orders are created, you will not be able to disable these options. If you need these options, we recommend using several categories rather than several shops.' => 'Įspėjimas: nepatartina įjungti "dalintis pirkėjais" ir "dalintis užsakymais" nuostatas. Kai ši galimybė bus sukurta ir bus pateikti užsakymai, jūs nebegalėsite išjungti šios savybės. Jei jums reikia šios galimybės, patariame naudoti keletą kategorijų vietoje kelių parduotuvių.',
    'Once this option is enabled, the shops in this group will share customers. If a customer registers in any one of these shops, the account will automatically be available in the others shops of this group.' => 'Kai šis nustatymas įjungtas, parduotuvės šioje grupėje dalinsis klientais. Jei klientas užsiregistruos  vienoje iš grupės parduotuvių, jo paskyra automatiškai bus prieinama ir kitose parduotuvėse.',
    'Warning: you will not be able to disable this option once you have registered customers.' => 'Įspėjimas: jums nebebus galima išjungti šio nustatymo tada, kai bus registruotų vartotojų.',
    'Once this option is enabled (which is only possible if customers and available quantities are shared among shops), the customer\'s cart will be shared by all shops in this group. This way, any purchase started in one shop will be able to be completed in another shop from the same group.' => 'Kai šis nustatymas yra įjungtas (jis įmanomas tik tada, kai klientai ir turimi pardavimo kiekiai paskirstomi tarp parduotuvių), tai kliento krepšelis bus bendras tarp visų parduotuvių toje grupėje. Tokiu būdu bet koks pardavimas, pradėtas vienoje parduotuvėje, turės galimybę būti užbaigtu ir kitose parduotuvėse, esančiose toje grupėje.',
    'Warning: You will not be able to disable this option once you\'ve started to accept orders.' => 'Įspėjimas: Jūs nebegalėsite išjungti šio nustatymo, kai pradėsite priimti užsakymus.',
    'Enable or disable this shop group?' => 'Įjungti ar išjungti šią parduotuvių grupę?',
    'If you want to add a virtual URL, you need to activate URL rewriting on your web server and enable Friendly URL option.' => 'Jei norite pridėti virtualų URL, jums reikia įjungti URL perrašymą savo web serveryje ir įjungti Draugiškas URL parinktį.',
    'You can use this option if you want to create a store with a URL that doesn\'t exist on your server (e.g. if you want your store to be available with the URL www.example.com/my-store/shoes/, you have to set shoes/ in this field, assuming that my-store/ is your Physical URL).' => 'Jūs galite naudoti šią funkciją, jei norite sukurti parduotuvę su URL, kuris neegzistuoja jūsų serveryje (pvz. jei norite, kad jūsų parduotuvė būtų prieinama per www.example.com/my-store/shoes/, jums reiktų įvesti shoes/ šiame lauke,  jeigu my-store/ yra fizinė direktorija - aplankas serveryje).',
    'URL rewriting must be activated on your server to use this feature.' => 'Norint naudoti šią funkciją reikia, kad serveryje būtų įjungta "URL perrašymo" galimybė.',
    'If you set this URL as the Main URL for the selected shop, all URLs set to this shop will be redirected to this URL (you can only have one Main URL per shop).' => 'Jei nustatysite šį URL kaip pagrindinį URL jūsų pasirinktai parduotuvei, visi URL nustatyti šiai parduotuvei bus peradresuojami į šį URL (vienai parduotuvei jūs galite turėti tik vieną pagrindtinį URL).',
    'Since the selected shop has no main URL, you have to set this URL as the Main URL.' => 'Kadangi pasirinkta parduotuvė neturi pagrindinio URL, privalote nustatyti šį URL kaip pagrindinį.',
    'The selected shop already has a Main URL. Therefore, if you set this one as the Main URL, the older Main URL will be set as a regular URL.' => 'Pasirinkta parduotuvė jau turi pagrindinį URL. Dėl to jei nustatysite šį URL kaip pagrindinį, senesnis pagrindinis URL bus nustatytas kaip įprastinis URL.',
    'This is the physical folder for your store on the web server. Leave this field empty if your store is installed on the root path. For instance, if your store is available at www.example.com/my-store/, you must input my-store/ in this field.' => 'Tai yra fizinis aplankas Jūsų parduotuvei Jūsų web serveryje. Palikite šį lauką tuščią, jei jūsų parduotuvė įdiegta šakniniame aplanke. Pvz., jei Jūsų parduotuvė prieinama per www.example.com/my-store/, tai Jūs turite įvesti my-store/ į laukelį.',
    'Warning: URL rewriting (e.g. mod_rewrite for Apache) seems to be disabled. If your Virtual URL doesn\'t work, please check with your hosting provider on how to activate URL rewriting.' => 'Įspėjimas: URL perrašymas (angl. URL rewriting - Apache modulis „mod_rewrite“) yra išjungtas. Jei jūsų virtualus URL neveikia, prašome kreiptis į hostingo tiekėją dėl „URL perrašymo“ aktyvavimo.',
    'Ignore this field if you don\'t use the Multistore tool. If you leave this field empty, the default shop will be used.' => 'Praleiskite šį lauką jei nenaudojate parduotuvių tinklo režimo. Jei paliksite šį lauką tuščią, bus naudojama pagrindinė parduotuvė.',
    'A category root is where a category tree can begin. This is used with multistore.' => 'Šakninė kategorija - tai pagrindinė kategorija nuo kurios prasideda visas kategorijų medis. Jis naudojamas parduotuvių tinklo režime.',
    'Enable Advanced Stock Management on product (0 = No, 1 = Yes)' => 'Įjungti išplėstinį prekės atsargų valdymą (0 = Ne, 1 = Taip)',
    '0 = Use quantity set in product, 1 = Use quantity from warehouse.' => '0 = Naudoti kiekį, nustatytą prekės puslapyje, 1 = Naudoti kiekį iš sandėlio.',
    'ID of the warehouse to set as storage.' => 'Sandėlio ID, kuris bus nustatytas kaip saugykla.',
    'Enable Advanced Stock Management on product (0 = No, 1 = Yes).' => 'Įjungti išplėstinį prekių atsargų valdymą (0 = Ne, 1 = Taip).',
    'This will add directives to your .htaccess file, which should improve caching and compression.' => 'Tai į .htaccess failą pridės direktyvas, kurios turi pagerinti kešavimą ir kompresiją.',
    'Enable or disable debug mode.' => 'Įjungti ar išjungti priežiūros režimą.',
    'Name of the second domain of your shop, (e.g. myshop-media-server-1.com). If you do not have another domain, leave this field blank.' => 'Tai jūsų parduotuvės antrojo domeno pavadinimas (pvz., mano-parduotuvės-media-serveris-1.com). Jei neturite kito domeno, palikite šį laukelį tuščią.',
    'Name of the third domain of your shop, (e.g. myshop-media-server-2.com). If you do not have another domain, leave this field blank.' => 'Tai jūsų parduotuvės trečiojo domeno pavadinimas (pvz., mano-parduotuvės-media-serveris-2.com). Jei neturite kito domeno, palikite šį laukelį tuščią.',
    'Name of the fourth domain of your shop, (e.g. myshop-media-server-3.com). If you do not have another domain, leave this field blank.' => 'Tai jūsų parduotuvės ketvirtojo domeno pavadinimas (pvz., mano-parduotuvės-media-serveris-3.com). Jei neturite kito domeno, palikite šį laukelį tuščią.',
    'Choose "No" to disable Product Combinations.' => 'Pasirinkite „Ne“, jei norite išjungti Prekės Derinius.',
    'You cannot set this parameter to No when combinations are already used by some of your products' => 'Negalima pasirinkti "Ne" kuomet prekių deriniai jau yra naudojami',
    'Choose "No" to disable Product Features.' => 'Pasirinkite „Ne“, jei norite išjungti Prekės Ypatybes.',
    'Choose "No" to disable Customer Groups.' => 'Pasirinkite „Ne“, jei norite išjungti Klientų Grupes.',
    'Should be enabled if you want to avoid to store the smarty cache on NFS.' => 'Turi būti įjungtas, jei norite išvengti smarty talpyklos saugojimo NFS (Network File System).',
    'Informative only' => 'Informacinis',
    'Warning' => 'Įspėjimas',
    'Error' => 'Klaida',
    'Major issue (crash)!' => 'Kritinė klaida (lūžis)',
    'How to restore a database backup in 10 easy steps' => 'Kaip atstatyti DB: 10 paprastų žingsnių',
    'Set "Enable Shop" to "No" in the "Maintenance" page under the "Preferences" menu.' => 'Išjunkite parduotuvę. Tai galite atlikti pasirinkę meniu "Nustatymai" » "Priežiūra".',
    'Download the backup from the list below or from your FTP server (in the folder "admin/backups").' => 'Parsisiųskite atsarginės kopijos failą iš sąrašo žemiau ar FTP serverio.',
    'Check the backup integrity: Look for errors, incomplete file, etc... Be sure to verify all of your data.' => 'Įsitikinkite, kad atsarginis failas tinkamas naudojimui. Sutikrinkite informaciją.',
    'Please ask your hosting provider for "phpMyAdmin" access to your database.' => 'Kreipkitės į hostingo tiekėją ir prašykite prieigos prie duomenų bazės per „phpMyAdmin“ valdymo pultą.',
    'Connect to "phpMyAdmin" and select your current database.' => 'Prisijunkite prie savo "phpMyAdmin" valdymo pulto.',
    'Unless you enabled the "Drop existing tables" option, you must delete all tables from your current database.' => 'Jūs turite ištrinti visas egzistuojančias lenteles nebent pasirinkote jas ištrinti nuostatose.',
    'At the top of the screen, please select the "Import" tab' => 'Viršutinėje ekrano dalyje pasrinkite Importuoti',
    'Click on the "Browse" button and select the backup file from your hard drive.' => 'Spauskite ant "Browse..." mygtuko ir pasirinkite savo failą iš kietojo disko.',
    'Check the maximum filesize allowed (e.g. Max: 16MB)' => 'Pasitikrinkite ar jis neviršija maksimalaus leidžiamo dydžio failo',
    'If your backup file exceeds this limit, contact your hosting provider for assistance. ' => 'Jei jūsų atsarginės kopijos failas viršiją leidžiamo dydžio limitą, susisiekite su hostingo paslaugos teikėju dėl pagalbos.',
    'Click on the "Go" button and please wait patiently for the import process to conclude. This may take several minutes.' => 'Spauskite mygtuką "Go" ir kantriai palaukite, kol importavimo procesas pasibaigs. Tai gali užtrukti kelias minutes.',
    'Click on the "%phpmyadmin_browse_label%" button and select the backup file from your hard drive.' => 'Spauskite mygtuką "%phpmyadmin_browse_label%" ir pasirinkite savo failą iš kietojo disko.',
    'Click on the "%phpmyadmin_go_label%" button and please wait patiently for the import process to conclude. This may take several minutes.' => 'Spauskite mygtuką "%phpmyadmin_go_label%" ir kantriai palaukite, kol importavimo procesas pasibaigs. Tai gali užtrukti kelias minutes.',
    'Drop existing tables during import.' => 'Ištrinti egzistuojančias lenteles importo metu.',
    'If enabled, the backup script will drop your tables prior to restoring data.' => 'Jei ši opcija įjungta, atsarginių kopijų skriptas ištrins jūsų lenteles prieš atstatydamas duomenis.',
    '(ie. "DROP TABLE IF EXISTS")' => '(pvz., "DROP TABLE IF EXISTS")',
    'You can read information on import at:' => 'Daugiau sužinoti apie informacijos importavimą galite čia:',
    'http://doc.prestashop.com/display/PS17/Import' => 'http://doc.prestashop.com/display/PS17/Import',
    'https://en.wikipedia.org/wiki/Comma-separated_values' => 'https://en.wikipedia.org/wiki/Comma-separated_values',
    'Allowed formats: .csv, .xls, .xlsx, .xlst, .ods, .ots' => 'Galimi formatai: .csv, .xls, .xlsx, .xlst, .ods, .ots',
    'Only UTF-8 and ISO 8859-1 encodings are allowed' => 'Leidžiami kodavimai: UTF-8 ir ISO 8859-1',
    'You can also upload your file via FTP to the following directory: %s .' => 'Jūs taip pat galite įkelti failą per FTP į šią direktoriją: %s.',
    'e.g. ' => 'pvz.',
    'If enabled, the product\'s reference number MUST be unique!' => 'Jei įjungta, prekės kodas TURI BŪTI unikalus!',
    'If you enable this option, your imported items\' ID number will be used as is. If you do not enable this option, the imported ID numbers will be ignored, and PrestaShop will instead create auto-incremented ID numbers for all the imported items.' => 'Jei įjungsite šį nustatymą, jūsų importuotų elementų ID skaičius bus naudojamas toks, koks duotas. Jei neįjungsite šio nustatymo, importuotų ID skaičius bus ignoruojamas ir PrestaShop sukurs automatiškai didėjančius ID numerius visiems importuotiems elementams.',
    'Sends an email to let you know your import is complete. It can be useful when handling large files, as the import may take some time.' => 'Išsiunčia el. laišką, kad žinotumėte, jog importavimas yra baigtas. Tai gali būti naudinga, kai tvarkomi dideli failai, kai importavimas užtrunka daug laiko.',
    'Read more about the CSV format at:' => 'Sužinokite daugiau apie CSV formatą čia:',
    'https://doc.prestashop.com/display/PS17/Import' => 'https://doc.prestashop.com/display/PS17/Import',
    'Where customers send messages from the order page.' => 'Kai klientas siunčia žinutę iš užsakymų puslapio.',
    'Fully qualified domain name (keep this field empty if you don\'t know).' => 'Visas domeno vardas (palikite tuščią, jei nežinote).',
    'IP address or server name (e.g. smtp.mydomain.com).' => 'IP arba severio pavadinimas (pvz.: smtp.domenas.lt).',
    'Leave blank if not applicable.' => 'Palikite tuščią, jie netaikoma.',
    'Your avatar in PrestaShop 1.7.x is your profile picture on %url%. To change your avatar, log in to PrestaShop.com with your email %email% and follow the on-screen instructions.' => 'Jūsų avataras PrestaShop 1.7.x sistemoje yra jūsų profilio paveiksliukas %url%. Jei norite jį pakeisti, prisijunkite prie PrestaShop.com su savo el. pašto adresu %email% ir sekite instrukcijas.',
    'Password should be at least %num% characters long.' => 'Slaptažodis turi būti bent %num% simbolių ilgio.',
    'PrestaShop can provide you with guidance on a regular basis by sending you tips on how to optimize the management of your store which will help you grow your business. If you do not wish to receive these tips, you can disable this option.' => 'PrestaShop gali jums kasdien suteikti naudingų patarimų, kaip optimizuoti parduotuvės valdymą, o tai gali padėti išaugti jūsų verslui. Jei nenorite gauti tokių patarimų, nuimkite varnelę.',
    'This page will be displayed just after login.' => 'Šis puslapis bus rodomas pirmas prisijungus prie administracinės dalies.',
    'Allow or disallow this employee to log in to the Admin panel.' => 'Leisti ar neleisti šiam darbuotojui prisijungti prie administratoriaus skydelio.',
    'Select the shops the employee is allowed to access.' => 'Pasirinkite parduotuves, prie kurių darbuotojams leidžiama prieiti.',
    'Severity levels' => 'Svarbumo lygiai',
    'Enter "5" if you do not want to receive any emails.' => 'Įveskite "5" jei nenorite gauti el. laiškų.',
    'Emails will be sent to the shop owner.' => 'El. laiškai bus siunčiami parduotuvės savininkui.',
    'How do I create a new SQL query?' => 'Kaip sukurti naują SQL užklausą?',
    'Click "Add New".' => 'Spauskite "Pridėti naują".',
    'Fill in the fields and click "Save".' => 'Užpildykite laukus ir spauskite "Išsaugoti"',
    'You can then view the query results by clicking on the Edit action in the dropdown menu' => 'Jūs galite peržiūrėti užklausos rezultatus, paspaudę "Redaguoti" išskleidžiamame meniu',
    'You can also export the query results as a CSV file by clicking on the Export button' => 'Jūs taip pat galite eksportuoti užklausos rezultatus kaip CSV failą, paspaudę mygtuką "Eksportuoti"',
    'Click "%add_new_label%".' => 'Spauskite „%add_new_label%“.',
    'Fill in the fields and click "%save_label%".' => 'Užpildykite laukus ir spauskite „%save_label%“.',
    'You can then view the query results by clicking on the "%view_label%" action in the dropdown menu' => 'Jūs galite peržiūrėti užklausos rezultatus, paspaudę „%view_label%“ išskleidžiamame meniu',
    'You can also export the query results as a CSV file by clicking on the "%export_label%" button' => 'Jūs taip pat galite eksportuoti užklausos rezultatus kaip CSV failą, paspaudę mygtuką "%export_label%"',
    'Quick description of the key: who it is for, what permissions it has, etc.' => 'Trumpas rakto aprašymas: kam jis skirtas, kokius leidimus jis turi ir pan.',
    'Before activating the webservice, you must be sure to: ' => 'Prieš aktyvuodami webservice paslaugą turite įsitikinti, ar: ',
    'Check that URL rewriting is available on this server.' => 'Patikrinkite, ar URL perrašymas (angl. "rewriting") galimas jūsų serveryje.',
    'Check that the five methods GET, POST, PUT, DELETE and HEAD are supported by this server.' => 'Serveryje palaikomi GET, POST, PUT, DELETE, HEAD metodai.',
    'Before choosing "Yes", check that PHP is not configured as an Apache module on your server.' => 'Prieš pasirinkdami "Taip", patikrinkite, ar PHP nėra sukonfigūruotas kaip Apache modulis jūsų serveryje.',
    'New modules and updates are displayed on the modules page.' => 'Nauji moduliai ir atnaujinimai rodomi modulių puslapyje.',
    'Check the IP address of the cookie in order to prevent your cookie from being stolen.' => 'Patikrinkite slapuko IP adresus, kad išvengtumėte jų vagystės.',
    'Set the amount of hours during which the front office cookies are valid. After that amount of time, the customer will have to log in again.' => 'Nurodykite valandų skaičių, kai parduotuvės slapukai bus galiojantys. Tam laikui praėjus, klientas turės vėl prisijungti.',
    'Set the amount of hours during which the back office cookies are valid. After that amount of time, the PrestaShop user will have to log in again.' => 'Nurodykite valandų skaičių, kai administracinės dalies slapukai bus galiojantys. Tam laikui praėjus, PrestaShop administratoriai ir darbuotojai turės vėl prisijungti.',
    'Set the maximum size allowed for attachment files (in megabytes). This value has to be lower or equal to the maximum file upload allotted by your server (currently: %size% MB).' => 'Nustatykite didžiausią leistiną prisegamo failo dydį (megabaitais). Jis turi būti mažesnis arba lygus didžiausiam failų įkėlimo dydžiui, nustatytam jūsų serveryje (dabar jis yra %size% MB).',
    'Define the upload limit for a downloadable product (in megabytes). This value has to be lower or equal to the maximum file upload allotted by your server (currently: %size% MB).' => 'Nurodykite skaitmeninės prekės dydžio įkėlimo limitą (megabaitais). Jis turi būti mažesnis arba lygus didžiausiam failų įkėlimo dydžiui, nustatytam jūsų serveryje (dabar jis yra %size% MB).',
    'Define the upload limit for an image (in megabytes). This value has to be lower or equal to the maximum file upload allotted by your server (currently: %size% MB).' => 'Nurodykite įkeliamo paveiksliuko dydžio limitą (megabaitais). Jis turi būti mažesnis arba lygus didžiausiam failų įkėlimo dydžiui, nustatytam jūsų serveryje (dabar jis yra %size% MB).',
    'Notifications are numbered bubbles displayed at the very top of your back office, right next to the shop\'s name. They display the number of new items since you last clicked on them.' => 'Pranešimai yra atvaizduojami skaičiais burbuliukuose administracinėje dalyje viršuje, šalia el. parduotuvės pavadinimo. Jie rodo skaičių naujų pranešimų skaičių nuo tada, kai paskutinį kartą juos tikrinote.',
    'This will display notifications when new orders are made in your shop.' => 'Rodyti pranešimą, kai parduotuvėje įvykdomi nauji užsakymai.',
    'This will display notifications every time a new customer registers in your shop.' => 'Rodyti pranešimus, kai parduotuvėje užsiregistruoja naujas klientas.',
    'This will display notifications when new messages are posted in your shop.' => 'Rodyti pranešimus, kai paliekama nauja žinutė parduotuvėje.',
    'When you access your back office and decide to stay logged in, your cookies lifetime defines your browser session. Set here the number of hours during which you want them valid before logging in again.' => 'Kai esate prisijungę prie parduotuvės administravimo dalies ir nusprendžiate likti prisijungę, slapukų galiojimo laikas nustato jūsų naršyklės sesiją. Čia nustatykite valandų skaičių, per kurį norite, kad jie galiotų, prieš vėl prisijungdami.',
    'Some features can be disabled in order to improve performance.' => 'Kai kurios ypatybės gali būti išjungtos siekiant padidinti našumą.',
    'CCC allows you to reduce the loading time of your page. With these settings you will gain performance without even touching the code of your theme. Make sure, however, that your theme is compatible with PrestaShop 1.4+. Otherwise, CCC will cause problems.' => 'CCC leidžia sutrumpinti puslapio įkėlimo laiką. Naudodamiesi šiais nustatymais pagreitinsite savo svetainę net nepaliesdami savo šablono, tačiau įsitikinkite, kad jis suderinamas su PrestaShop 1.4+ versija, kitaip, patirsite sutrikimų.',
  ),
