  'AdminCatalogHelp' => 
  array (
    'Does not apply to the shipping costs' => 'Netaikomas pristatymo kainoms',
    'Optional: The cart rule will be available to everyone if you leave this field blank.' => 'Neprivaloma:  jei paliksite tuščią, krepšelio taisyklė bus prieinama visiems.',
    'The default period is one month.' => 'Numatytasis laikotarpis - vienas mėnuo.',
    'You can choose a minimum amount for the cart either with or without the taxes and shipping.' => 'Galite pasirinkti minimalią krepšelio sumą su pristatymo kaina arba be jos.',
    'The cart rule will be applied to the first "X" customers only.' => 'Krepšelio taisyklė bus pritaikyta tik X pirmiesiems vartotojams.',
    'A customer will only be able to use the cart rule "X" time(s).' => 'Klientas galės pasinaudoti šia taisykle tik X kartą (-ų).',
    'This restriction applies to the country of delivery.' => 'Šis apribojimas taikomas šalyje, kurioje bus atliktas pristatymas.',
    'This will be displayed in the cart summary, as well as on the invoice.' => 'Bus rodoma krepšelio santraukoje ir sąskaitoje.',
    'For your eyes only. This will never be displayed to the customer.' => 'Rodoma tik jums, nerodoma vartotojams.',
    'This is the code users should enter to apply the voucher to a cart. Either create your own code or generate one by clicking on "Generate".' => 'Tai yra kodas, kuri vartotojai turėtų įvesti norėdami pridatikyti kuponą krepšeliui. Sukurkite savo kodą arba spauskite mygtuką "Sugeneruoti" naujam kodui sugeneruoti.',
    'Caution! If you leave this field blank, the rule will automatically be applied to benefiting customers.' => 'Dėmesio! Jei paliksite šį laukelį tuščią, taisyklė bus automatiškai taikoma klientams.',
    'If the voucher is not yet in the cart, it will be displayed in the cart summary.' => 'Jei kuponas dar nėra krepšelyje, jis bus rodomas po krepšeliu, jo santraukoje.',
    'Only applicable if the voucher value is greater than the cart total.' => 'Taikoma tik jei kupono vertė yra didesnė už krepšelio.',
    'If you do not allow partial use, the voucher value will be lowered to the total order amount. If you allow partial use, however, a new voucher will be created with the remainder.' => 'Jei neleidžiate dalinio naudojimo, kupono vertė bus sumažinta iki visos pirkinio sumos. Jei leidžiate dalinį naudojimą, su likusia suma bus sukurtas naujas kuponas.',
    'Cart rules are applied by priority. A cart rule with a priority of "1" will be processed before a cart rule with a priority of "2".' => 'Krepšelio taisyklės pritaikomos pagal prioritetą. Krepšelio taisyklė su prioritetu "1" bus pritaikyta prieš krepšelio taisyklę su prioritetu "2".',
    'If you want a category to appear in the menu of your shop, go to [1]Modules > Modules & Services > Installed modules.[/1] Then, configure your menu module.' => 'Jei norite, kad jūsų parduotuvės meniu būtų kategorija, eikite [1]Moduliai > Moduliai ir paslugos > Įdiegti moduliai.[/1] Ten konfigūruokite savo meniu modulį.',
    'Recommended dimensions (for the default theme): %1spx x %2spx' => 'Rekomenduojami matmenys (numatytajai temai): %1spx x %2spx',
    'If you want a category to appear in the menu of your shop, go to [1]Modules > Modules Manager.[/1] Then, configure your menu module.' => 'Jei norite, kad kategorija atsirstų jūsų parduotuvės meniu, eikite [1]Moduliai > Modulių valdymas.[/1] Ten konfigūruokite savo meniu modulį.',
    'Your internal name for this attribute.' => 'Vidinis šios savybės pavadinimas.',
    'The public name for this attribute, displayed to the customers.' => 'Viešas pavadinimas šiai savybei, kuris bus rodomas klientams.',
    'The way the attribute\'s values will be presented to the customers in the product\'s page.' => 'Būdas, kuriuo savybės reikšmės bus atvaizduojamos vartotojams prekės puslapyje.',
    'Choose the attribute group for this value.' => 'Pasirinkite savybių grupę šiai reikšmei.',
    'Choose a color with the color picker, or enter an HTML color (e.g. "lightblue", "#CC6600").' => 'Pasirinkite norimą spalvą naudodamiesi spalvų pasirinkimo įrankiu arba įrašykite HTML spalvos kodą (pvz.: "lightblue", "#CC6600").',
    'Upload an image file containing the color texture from your computer.' => 'Įkelti paveiksliuko failą, kuriame yra spalvos tekstūra.',
    'This will override the HTML color!' => 'Tai perrašys HTML spalvą!',
    'Save then add another value' => 'Išsaugoti ir pridėti kitą reikšmę',
    'To add "tags," click in the field, write something, and then press "Enter."' => 'Norėdami sukurti "žymą", spustelėkite laukelyje, ką nors parašykite ir paspauskite "Enter."',
    'Allow customers to upload files using the contact page.' => 'Leisti vartotojams įkelti failus naudojantis kontaktų puslapiu.',
    'Please fill out the message fields that appear by default when you answer a thread on the customer service page.' => 'Prašome užpildyti visus automatiškai atsirandančius laukus, kai bandote atsakyti į temą klientų aptarnavimo puslapyje.',
    'URL for your IMAP server (ie.: mail.server.com).' => 'Jūsų IMAP serverio URL (pvz.: mail.domenas.lt).',
    'Port to use to connect to your IMAP server.' => 'Portas, kuris naudojamas prisijungimui prie IMAP serverio.',
    'User to use to connect to your IMAP server.' => 'Naudotojo vardas, kuris naudojamas prisijungimui prie IMAP serverio.',
    'Password to use to connect your IMAP server.' => 'Slaptažodis, kuris naudojamas prisijungimui prie IMAP serverio.',
    'Delete messages after synchronization. If you do not enable this option, the synchronization will take more time.' => 'Ištrinti žinutes po sinchronizacijos. Jei neįjungta, tuomet sinchronizacija užtruks ilgiau.',
    'Create new threads for unrecognized emails.' => 'Sukurti naują temą neatpažintiems laiškams.',
    'Use POP3 instead of IMAP.' => 'Naudokite POP3 vietoj IMAP.',
    'Do not use RSH or SSH to establish a preauthenticated IMAP sessions.' => 'Nenaudokite RSH arba SSH nustatant gamykliškai autentiškas IMAP sesijas. ',
    'Use the Secure Socket Layer (TLS/SSL) to encrypt the session.' => 'Naudokite Secure Socket Layer (TLS/SSL) sesijos užkodavimui.',
    'Validate certificates from the TLS/SSL server.' => 'Patvirtinkite sertifikatus iš TLS/SSL serverio.',
    'Do not validate certificates from the TLS/SSL server. This is only needed if a server uses self-signed certificates.' => 'Nepatvirtinkite sertifikatų iš TLS/SSL serverio. Ši funkcija reikalinga tik tada, kai serveris naudoja paties sugeneruotus sertifikatus.',
    'Force use of start-TLS to encrypt the session, and reject connection to servers that do not support it.' => 'Sesijos šifravimui priverstinai naudokite start-TLS ir atmeskite prisijungimą prie serverio, kuris nepalaikio šio šifravimo.',
    'Do not use start-TLS to encrypt the session, even with servers that support it.' => 'Sesijos šifravimui nenaudokite start-TLS net tada, kai serveris šį šifravimą palaiko.',
    'Add new feature value' => 'Pridėti naujos ypatybės reikšmę',
    'Save and add another value' => 'Išsaugoti ir pridėti kitą reikšmę',
    'Back to the list' => 'Atgal į sąrašą',
    'Add new feature values' => 'Pridėti naujas ypatybės reikšmes',
    'To add "tags," click inside the field, write something, and then press "Enter."' => 'Norėdami pridėti "žymas", paspauskite ant lauko, įrašykite ką nors ir paspauskite "Enter".',
    'Company name for this brand' => 'Įmonės pavadinimas šiam prekės ženklui',
    'Company name for this supplier' => 'Įmonės pavadinimas šiam tiekėjui',
    'To add "tags" click in the field, write something and then press "Enter".' => 'Norėdami sukurti "žymas", spustelėkite laukelyje, ką nors parašykite ir paspauskite "Enter".',
    'Create a new product: CTRL+P' => 'Sukurti naują prekę: `Ctrl + P`',
    'To have a different title from the category name, enter it here.' => 'Jei norite turėti skirtingą pavadinimą nei kategorijos pavadinimas, įveskite jį čia.',
    'To have a different description than your category summary in search results page, write it here.' => 'Jei norite turėti skirtingą kategorijos santraukos aprašymą paieškos rezultatų puslapyje, įveskite jį čia.',
    'Search for a product' => 'Ieškoti prekės',
    'Enter your product name' => 'Įveskite prekės pavadinimą',
    'The summary is a short sentence describing your product.<br />It will appears at the top of your shop\'s product page, in product lists, and in search engines\' results page (so it\'s important for SEO). To give more details about your product, use the "Description" tab.' => 'Santrauka yra trumpas ir aiškus sakinys, apibūdinantis jūsų prekę. Jeigu reikia gali būti daugiau negu vienas.<br />Santrauka bus matoma prekės puslapio viršuje, prekių sąrašuose ir paieškos sistemų rezultatų puslapiuose (todėl tai labai svarbu SEO).<br />Daugiau išsamios informacijos apie savo prekę įveskite skirtuke „Aprašymas“.',
    'Search and add a related product' => 'Ieškoti ir pridėti susijusią prekę',
    'Use a comma to create separate tags. E.g.: dress, cotton, party dresses.' => 'Naudokite kablelį, norėdami atskirti gaires. Pvz.: suknelė, medvilnė, kokteilinė suknelė.',
    'Per kilo, per litre' => 'Už kilogramą, už litrą',
    'Combine several attributes, e.g.: "Size: all", "Color: red".' => 'Sujunkite keletą savybių, pvz.: „Dydis: visi“, „Spalva: raudona“.',
    'Leave empty to disable' => 'Jei norite išjungti palikite tuščią',
    'To have a different title from the product name, enter it here.' => 'Jei norite turėti skirtingą pavadinimą nei prekės pavadinimas, įveskite jį čia.',
    'Public title for the product\'s page, and for search engines. Leave blank to use the product name. The number of remaining characters is displayed to the left of the field.' => 'Viešas pavadinimas prekės puslapiui ir paieškos sistemoms. Palikite tuščia, jei naudosite prekės pavadinimą. Likusių simbolių skaičius rodomas kairėje lauko pusėje.',
    'To have a different description than your product summary in search results pages, write it here.' => 'Jei norite turėti skirtingą prekės santraukos aprašymą paieškos rezultatų puslapyje, rašykite jį čia.',
    'This description will appear in search engines. You need a single sentence, shorter than 160 characters (including spaces)' => 'Šis aprašymas bus rodomas paieškos varikliuose. Jums reikia įvesti vieną sakinį, trumpesnį nei 160 simbolių (tarpai įskaičiuoti)',
    'To which product the page should redirect?' => 'Į kurią prekę turi nukreipti puslapis?',
    'To which category the page should redirect?' => 'Į kurią kategoriją puslapis turi nukreipti?',
    'If no category is selected the Main Category is used' => 'Jei kategorijoje nepasirinkta, naudojama pagrindinė kategorija',
    'Only letters and the minus (-) character are allowed.' => 'Leidžiamos tik raidės ir minuso ženklas ("-").',
    'Search name' => 'ieškoti pavadinimo',
    'Search ref.' => 'ieškoti kodo',
    'Search category' => 'ieškoti kategorijos',
    'Permanently delete this product.' => 'Visam laikui ištrinti šią prekę.',
    'See how your product sheet will look online: ALT+SHIFT+V' => 'Pažiūrėkite, kaip jūsų prekė atrodo parduotuvėje: ALT+SHIFT+V',
    'Enable or disable the product on your shop: ALT+SHIFT+O' => 'Įjungti ar išjungti prekę parduotuvėje: ALT+SHIFT+O',
    'Save the product and stay on the current page: ALT+SHIFT+S' => 'Išsaugokite prekę ir likite dabartiniame puslapyje: ALT+SHIFT+S',
    'Save and duplicate this product, then go to the new product: ALT+SHIFT+D' => 'Išsaugokite ir kopijuokite prekę, tuomet eikite į naują prekę: ALT+SHIFT+D',
    'Save and go back to the catalog: ALT+SHIFT+Q' => 'Išsaugokite ir grįžkite atgal į katalogą: ALT+SHIFT+Q',
    'Save and create a new product: ALT+SHIFT+P' => 'Išsaugokite ir sukurkite naują prekę: ALT+SHIFT+P',
    'Is the product a pack (a combination of at least two existing products), a virtual product (downloadable file, service, etc.), or simply a standard, physical product?' => 'Ar tai prekių komplektas (skirtingų prekių rinkinys), virtuali prekė (parsisiunčiamas failas, paslauga, t.t.), paprasta, standartinė, fizinė prekė?',
    'Where should the product be available on your site? The main category is where the product appears by default: this is the category which is seen in the product page\'s URL. Disabled categories are written in italics.' => 'Kur puslapyje turi būti matoma prekė? Pagrindinė kategorija yra prekės numatyta pagal nutylėjimą vieta: tai yra kategorija, kuri matoma prekės puslapio URL. Išjungtos kategorijos rašomos kursyvu.',
    'Search categories' => 'Ieškoti kategorijose',
    'If you want to quickly create a new category, you can do it here. Don’t forget to then go to the Categories page to fill in the needed details (description, image, etc.).  A new category will not automatically appear in your shop\'s menu, please read the Help about it.' => 'Jei norite greitai sukurti naują kategoriją, tai galite padaryti čia. Nepamirškite nueiti į kategorijos puslapį ir užpildyti reikiamą informaciją (aprašymą, paveisliukus, ir t.t.). Nauja kategorija automatiškai neatsiras jūsų parduotuvės meniu, plačiau skaitykite Pagalboje.',
    'Does this combination have a different price? Is it cheaper or more expensive than the default retail price?' => 'Ar ši kombinacija turi skirtingą kainą? Tai mažesnė ar didesnė kaina negu numatytoji mažmeninė kaina?',
    'Combinations are the different variations of a product, with attributes like its size, weight or color taking different values. To create a combination, you need to create your product attributes first. Go to Catalog > Attributes & Features for this!' => 'Deriniai yra skirtingi prekių variantai su tokiomis savybėmis kaip dydis, svoris ar spalva, turinčias skirtingas reikšmes. Norėdami sukurti derinį, pirmiausia turite sukurti prekės savybes. Eikite į „Katalogas“ » „Savybės ir ypatybės“!',
    'To add combinations, you first need to create proper attributes and values in [1]Attributes & Features[/1]. <br> When done, you may enter the wanted attributes (like "size" or "color") and their respective values ("XS", "red", "all", etc.) in the field below; or simply select them from the right column. Then click on "Generate": it will automatically create all the combinations for you!' => 'Norėdami pridėti derinius, pirmiausia turite sukurti savybes su reikšmėmis [1]Savybės ir ypatybės[/1] srityje. <br> Kai baigsite, žemiau esančiame lauke turite įvesti norimas savybes (pvz., "dydis" ar "spalva") ir atitinkamas jų reikšmes ("XS", "raudona","visi" ir t.t.); arba tiesiog pasirinkti iš stulpelio dešinėje. Tuomet paspauskite "Generuoti": deriniai bus sukurti automatiškai!',
    'To add combinations, you first need to create proper attributes and values in [1]%attributes_and_features_label%[/1]. <br> When done, you may enter the wanted attributes (like "size" or "color") and their respective values ("XS", "red", "all", etc.) in the field below; or simply select them from the right column. Then click on "%generate_label%": it will automatically create all the combinations for you!' => 'Norėdami pridėti derinius, pirmiausia turite sukurti savybes su reikšmėmis puslapyje [1]%attributes_and_features_label%[/1].<br>Kai baigsite, žemiau esančiame lauke turite įvesti norimas savybes (pvz.: „dydis“ ar „spalva“) ir atitinkamas jų reikšmes („XS“, „raudona“,„visi“ ir t.t.); arba tiesiog pasirinkti iš stulpelio dešinėje. Tuomet paspauskite „%generate_label%“: deriniai bus sukurti automatiškai!',
    'This is the human-readable URL, as generated from the product\'s name. You can change it if you want.' => 'Tai yra žmogui perskaitoma nuoroda, sugeneruota iš prekės pavadinimo.',
    'When your product is disabled, choose to which page you’d like to redirect the customers visiting its page by typing the product or category name.' => 'Kai prekė yra išjungta, pasirinkite, į kurį puslapį norite nukreipti lankytoją, įvesdami prekės ar kategorijos pavadinimą.',
    'No redirection (404) = Do not redirect anywhere and display a 404 "Not Found" page.' => 'Neperadresuota (404) = Niekur nenukreipti ir rodyti "404 Nieko nerasta" puslapį.',
    'Permanent redirection (301) = Permanently display another product or category instead.' => 'Nuolatinis peradresavimas (301) = Nuolatos rodyti kitą prekę ar kategoriją.',
    'Temporary redirection (302) = Temporarily display another product or category instead.' => 'Laikinas peradresavimas (302) =Laikinai rodyti kitą prekę ar kategoriją vietoj jos.',
    'Display delivery time for a product is advised for merchants selling in Europe to comply with the local laws.' => 'Prekybininkams Europoje patariama atvaizduojamą prekės pristatymo laiką derinti su vietiniais įstatymais.',
    'edit' => 'redaguoti',
    'If a carrier has a tax, it will be added to the shipping fees. Does not apply to free shipping.' => 'Jei vežėjas turi mokestį, jis bus pridėtas prie pristatymo kainos. Netaikoma nemokamam pristatymui.',
    'This interface allows you to specify the suppliers of the current product and its combinations, if any.' => 'Ši sąsaja leidžia jums nurodyti tiekėjus šiai prekei ir jos deriniams, jei reikia.',
    'You can specify supplier references according to previously associated suppliers.' => 'Taip pat galite nurodyti tiekėjo nuorodą su anksčiau įvestais tiekėjais.',
    'When using the advanced stock management tool (see Shop Parameters > Products settings), the values you define (price, references) will be used in supply orders.' => 'Kai naudojamas išplėstinis atsargų valdymo įrankis (žiūrėkite Parduotuvės parametrai->Prekės nustatymai), vertės, kurias nurodote (kainos, kodai), bus naudojamos tiekimo užsakymuose.',
    'You can specify product reference(s) for each associated supplier. Click "Save" after changing selected suppliers to display the associated product references.' => 'Galite nurodyti prekės kodą pagal kiekvieną tiekėją. Paspauskite "Išsaugoti" po tiekėjo pasirinkimo, kad pamatytumėte susietą prekės kodą.',
    'You can specify product reference(s) for each associated supplier. Click "%save_label%" after changing selected suppliers to display the associated product references.' => 'Galite nurodyti prekės kodą pagal kiekvieną tiekėją. Paspauskite „%save_label%“ po tiekėjo pasirinkimo, kad pamatytumėte susietą prekės kodą.',
    'This interface allows you to specify the warehouse in which the product is stocked.' => 'Ši sąsaja leidžia jums nurodyti sandėlį, kuriame laikoma prekė.',
    'It is also possible to specify the location within the warehouse for each product or combination.' => 'Taip pat galima nurodyti kiekvienos prekės ar derinio vietą sandėlio viduje.',
    'Number of days this file can be accessed by customers. Set to zero for unlimited access.' => 'Dienų skaičius, kol failas bus prieinamas pirkėjams. Nustatykite 0 neribotam priėjimui.',
    'Upload a file from your computer (%maxUploadSize% max.)' => 'Įkelkite failą iš savo kompiuterio (%maxUploadSize% maks.)',
    'The full filename with its extension (e.g. Book.pdf)' => 'Pilnas pavadinimas su plėtiniu (pvz., Knyga.pdf)',
    'Number of downloads allowed per customer. Set to 0 for unlimited downloads.' => 'Leistinas parsisiuntimų skaičius kiekvienam vartotojui. Nustatykite 0 neribotiems atsisiuntimams.',
    'If set, the file will not be downloadable after this date. Leave blank if you do not wish to attach an expiration date.' => 'Jei nurodyta, failas bus nepasiekiamas parsisiuntimui po šios datos. Palikite lauką tuščią jei nenorite nustatyti galiojimo pabaigos datos.',
    'The minimum quantity required to buy this product (set to 1 to disable this feature). E.g.: if set to 3, customers will be able to purchase the product only if they take at least 3 in quantity.' => 'Minimalus kiekis, būtinas norint įsigyti šią prekę (nurodžius 1 - parinktis išjungiama). Pvz.: jei nurodysite 3, pirkėjas galės įsigyti prekę, jei nurodys 3 prekės vnt.',
    'The email will be sent to all the users who have the right to run the stock page. To modify the permissions, go to [1]Advanced Parameters > Team[/1]' => 'El. laiškas bus išsiųstas visiems darbuotojams, kurie turi prieigą prie atsargų puslapio. Norėdami redaguoti leidimus, eikite [1]Išplėstiniai parametrai » Darbuotojai[/1]',
    'Combinations are the different variations of a product, with attributes like its size, weight or color taking different values. Does your product require combinations?' => 'Deriniai yra skirtingi prekių variantai, su tokiomis savybėmis kaip dydis, svoris ar spalva, atsižvelgiant į skirtingas reikšmes. Ar jūsų prekė reikalauja derinių?',
    'Advanced settings in [1][2]Combinations[/1]' => 'Išplėstiniai nustatymai [1][2]Deriniuose[/1]',
