  'AdminDashboardHelp' => 
  array (
    'This mode displays sample data so you can try your dashboard without real numbers.' => 'Šis rėžimas rodo testinius duomenis, kad jūs galėtumėte išbandyti skydelį be tikrtų duomenų.',
    'Choose a fixed fee for each order placed in %currency% with %module%.' => 'Pasirinkite fiksuotą mokestį kiekvienam užsakymui, pateiktam %currency% su %module%.',
