    'You should calculate this percentage as follows: ((total sales revenue) - (cost of goods sold)) / (total sales revenue) * 100. This value is only used to calculate the Dashboard approximate gross margin, if you do not specify the wholesale price for each product.' => 'Turėtumėte apskaičiuoti šią procentinę dalį taip: ((visos pardavimų pajamos) - (prekių savikaina)) / (visos pardavimų pajamos) * 100. Šis dydis naudojamas skydelyje apytiksliai apskaičiuoti bendrąjį pelną, jei jūs nenurodote didmeninės kainos kiekvienai prekei.',
