  'AdminDesignHelp' => 
  array (
    'By default, all images settings are already installed in your store. Do not delete them, you will need it!' => 'Pagal nutylėjimą, visi paveiksliukų nustatymai jau įdiegti jūsų parduotuvėje. Neištrinkite jų, jums jų reikės!',
    'Regenerates thumbnails for all existing images' => 'Iš naujo sukuria miniatiūras visiems prekių vaizdams',
    'Please be patient. This can take several minutes.' => 'Būkite kantrūs - tai gali užtrukti kelias minutes',
    'Be careful! Manually uploaded thumbnails will be erased and replaced by automatically generated thumbnails.' => 'Dėmesio! Rankiniu būdu sukurtos miniatiūros bus ištrintos automatiškai sukurtų miniatiūrų.',
    'Select "No" only if your server timed out and you need to resume the regeneration.' => 'Pasirinkite "Ne" tik jeigu jūsų serveris sugeneravo "time out" klaidą ir jūs norite tęsti pergeneravimą.',
    'Please select a module' => 'Pasirinkite modulį',
    'Select a module above before choosing from available hooks' => 'Aukščiau pasirinkite modulį, prieš pasirinkdami galimus hukus',
    'Please specify the files for which you do not want the module to be displayed.' => 'Nurodykite failus, kuriuos nenorite, kad modulis rodytų.',
    'Please input each filename, separated by a comma (",").' => 'Įveskite kiekvieną failo pavadinimą, atskirtą kableliu (",").',
    'You can also click the filename in the list below, and even make a multiple selection by keeping the Ctrl key pressed while clicking, or choose a whole range of filename by keeping the Shift key pressed while clicking.' => 'Jūs taip pat galite paspausti ant failo pavadinimo, esančio žemiau sąraše, arba pasirinkti kelis vienu metu, laikant Ctrl klavišą ir spaudžiant pele, arba intervalą - spaudžiant pele, kol laikomas Shift klavišas.',
    'To add "tags" click in the field, write something, and then press "Enter."' => 'Norėdami sukurti "žymą", spustelėkite laukelyje, ką nors parašykite ir paspauskite "Enter."',
    'JPEG images have a small file size and standard quality. PNG images have a larger file size, a higher quality and support transparency. Note that in all cases the image files will have the .jpg extension.' => 'JPEG užima mažai vietos ir yra standartinės kokybės. PNG didesni, tačiau geresnės kokybės ir gali būti permatomi. Atkreipkite dėmesį, kad bet kuriuo atveju paveiksliukas turės .jpg galūnę.',
    'WARNING: This feature may not be compatible with your theme, or with some of your modules. In particular, PNG mode is not compatible with the Watermark module. If you encounter any issues, turn it off by selecting "Use JPEG".' => 'ĮSPĖJIMAS: šis funkcionalumas gali būti nesuderinamas su jūsų tema ir kai kuriais moduliais. Pavyzdžiui, PNG rėžimas nesuderinamas su "Watermark" moduliu. Jei iškils kokių nesklandumų naudokite JPEG rėžimą.',
    'Ranges from 0 (worst quality, smallest file) to 100 (best quality, biggest file).' => 'Svyruoja nuo 0 (prasčiausia, mažiausias failas) iki 100 (geriausia, didžiausias failas).',
    'Recommended: 90.' => 'Rekomenduojama: 90.',
    'PNG compression is lossless: unlike JPG, you do not lose image quality with a high compression ratio. However, photographs will compress very badly.' => 'PNG glaudinimas yra "be nuostolių", skirtingai nuo JPG, neprarandama vaizdo kokybė pasirinkus aukštą glaudinimo santykį (reikšmę).
Tačiau, glaudinant nuotraukas vistiek praradimas bus didelis.',
    'Ranges from 0 (biggest file) to 9 (smallest file, slowest decompression).' => 'Intervalas nuo 0 (didžiausias failas) iki 9 (mažiausias failas, lėčiausias išskleidimas).',
    'Recommended: 7.' => 'Rekomenduojama: 7.',
    'The maximum file size of pictures that customers can upload to customize a product (in bytes).' => 'Maksimalus failo dydis (baitais) paveiksliukams, kuriuos įkelia klientai prekės personalizacijai.',
    'Width of product customization pictures that customers can upload (in pixels).' => 'Prekių personalizacijos paveiksliukų plotis (pikseliais).',
    'Height of product customization pictures that customers can upload (in pixels).' => 'Prekių personalizacijos paveiksliukų aukštis (pikseliais).',
    'This will generate an additional file for each image (thus doubling your total amount of images). Resolution of these images will be twice higher.' => 'Bus sukurtas papildomas failas kiekvienam paveiksliukui (bus padvigubintas bendras paveiksliukų kiekis). Šių paveiksliukų rezoliucija bus dvigubai didesnė.',
    'Enable to optimize the display of your images on high pixel density screens.' => 'Įjungti paveiksliukų atvaizdavimo optimizavimą ant aukštos raiškos ekranų.',
    'This should be set to yes unless you successfully moved images in "Images" page under the "Preferences" menu.' => 'Ši nuostata turi būti nustatyta "taip", nebent jūs sėkmingai perkėlėte paveiksliukus "Paveiksliukų" puslapyje "Nuostatų" meniu.',
    'Letters, underscores and hyphens only (e.g. "small_custom", "cart_medium", "large", "thickbox_extra-large").' => 'Tik: raidės, žemas pabraukimas ir brūkšnelis (pvz.: "mazas_iprastas" , "krepselis_vidutinis" , "didelis" , "preke_labai-didelis").',
    'Maximum image width in pixels.' => 'Didžiausias vaizdo plotis pikseliais.',
    'Maximum image height in pixels.' => 'didžiausias vaizdo aukštis pikseliais.',
    'This type will be used for Product images.' => 'Šis tipas bus naudojamas prekių paveiksliukams.',
    'This type will be used for Category images.' => 'Šis tipas bus naudojamas kategorijos paveiksliukams.',
    'This type will be used for Brand images.' => 'Šis tipas bus naudojamas prekės ženklių paveiksliukams.',
    'This type will be used for Supplier images.' => 'Šis tipas bus naudojamas tiekėjo paveiksliukams.',
    'This type will be used for Store images.' => 'Šis tipas bus naudojamas "Parduotuvės" paveiksliukams.',
    'E.g. address, addresses, attachment' => 'Pvz. adresas, adresai, priedai',
    'Will appear on main page. Recommended size for the default theme: height %height% and width %width%.' => 'Bus rodoma pagrindiniame puslapyje. Rekomenduojami dydžiai numatytajai temai: aukštis %height% ir plotis %width%.',
    'Warning: you can use a PNG file for transparency, but it can take up to 1 second per page for processing. Please consider using JPG instead.' => 'Įspėjimas: Jūs galite naudoti PNG failą dėl permatomumo, bet tai gali padidinti puslapio generavimo procesą papildoma sekunde. Pasvarstykite, ar verta naudoti JPEG.',
    'It is the small icon that appears in browser tabs, next to the web address' => 'Tai maža ikonėlė, rodoma naršyklės skirtuke šalia web adreso',
    'Be careful! Please check your theme in an RTL language before generating the RTL stylesheet: your theme could be already adapted to RTL.\\nOnce you click on "Adapt to RTL", any RTL-specific file that you might have added to your theme might be deleted by the created stylesheet.' => 'Būkite atsargūs! Patikrinkite savo temą RTL kalboje prieš sukurdami RTL stiliaus lentelę: jūsų tema jau gali būti pritaikyta RTL.\\nKai paspausite "Pritaikyti RTL", bet kuris jau prie jūsų temos pridėtas RTL failas gali būti ištrintas sukuriant stilių lentelę.',
    'Used in the h1 page tag, and as the default title tag value.' => 'Naudojama h1 puslapio žymė ir kaip numatytoji pavadinimo žymė.',
    'Used to override the title tag value. If left blank, the default title value is used.' => 'Naudojamas pavadinimo žymės reikšmės perrašymui. Jei palikta tuščia, naudojama numatytoji pavadinimo reikšmė.',
    'Create meaningful content' => 'Kurk prasmingą turinį',
    'Because it is not just selling products but also creating a universe, build pages to tell stories and catch your visitors’ interest, to turn them into loyal customers.' => 'Kadangi tai nėra tik produkto pardavimas, bet ir pasaulio sukūrimas, kurk puslapius, kuriuose pasakojamos istorijos ir pagaunamas lankytojo dėmesys, kad jis taptų lojaliu klientu.',
    'Add new page category' => 'Pridėti naują kategorijos puslapį',
    'Add new page' => 'Pridėti naują puslapį',
    'This won\'t regenerate email templates, it only sets the default email theme for future generation (when a language is installed for example).' => 'Tai ne atnaujins el. laiškų šablonų, tai tik nustatys numatytąją el. laiškų temą, kuri bus naudojama vėliau (pvz., kai bus įdiegta kalba).',
    'PrestaShop\'s email templates are stored in the "mails" folder, but they can be overridden by your current theme\'s own "mails" folder. Using this option enables to overwrite emails from your current theme.' => 'PrestaShop el. laiškų šablonai yra saugomi „mails“ aplanke, tačiau jie gali būti pakeisti jūsų naudojamos temos savu "mails" aplanku. Naudojant šią parinktį, galite perrašyti el. laiškų šablonus iš naudojamos temos.',
    'By default, existing email template files are not modified to avoid deleting any modification you may have done. Enable this option to force the overwrite.' => 'Pagal numatytuosius nustatymus esami el. laiškų šablonų failai nekeičiami, kad būtų išvengta jūsų padarytų pakeitimų pašalinimo. Įjunkite šią parinktį, kad įgalintumėte perrašymą.',
    'No emails were detected in any theme folder so this field is disabled.' => 'Laiškų neaptikta jokiame temos kataloge, todėl šis laukas yra išjungtas.',
    'Will appear on email headers. If undefined, the header logo will be used.' => 'Bus rodomas el. laiškų antraštėse. Jei nenurodytas - bus rodomas antraštės logotipas.',
    'Warning: if no invoice logo is available, the main logo will be used instead.' => 'Įspėjimas: neradus/nenurodžius sąskaitai-faktūrai skirto logotipo bus naudojamas pagrindinis logotipas.',
    'Will appear on invoice headers.' => 'Bus rodoma sąskaitų antraštėje.',
    'Use our [1]favicon generator on PrestaShop Marketplace[/1] to boost your brand image!' => 'Naudokite mūsų [1]favicon generatorių PrestaShop prekyvietėje[/1], kad sustiprintumėte savo prekinį ženklą!',
    'Will appear on your main page. Recommended size for the default theme: height %height% and width %width%.' => 'Bus matoma pagrindiniame puslapyje. Rekomenduojami dydžiai numatytajai temai: aukštis %height% ir plotis %width%.',
    'It is the small icon that appears in browser tabs, next to the title.' => 'Tai yra maža piktograma, kuri atsiranda naršyklės skirtukuose, šalia antraštės.',
    'Be careful! Please check your theme in an RTL language before generating the RTL stylesheet: your theme could be already adapted to RTL.
Once you click on "Adapt to RTL", any RTL-specific file that you might have added to your theme might be deleted by the created stylesheet.' => 'Būkite atsargūs! Patikrinkite savo temą RTL kalboje prieš sukurdami RTL stilių failą: jūsų tema jau gali būti pritaikyta RTL.
Kai paspausite "Pritaikyti RTL", bet kuris jau prie jūsų temos pridėtas RTL failas gali būti ištrintas/perrašytas sukuriant naują stilių failą.',
    'Be careful! Please check your theme in an RTL language before generating the RTL stylesheet: your theme could be already adapted to RTL.
Once you enable the "%generate_rtl_label%" option, any RTL-specific file that you might have added to your theme might be deleted by the created stylesheet.' => 'Būkite atsargūs! Patikrinkite savo temą RTL kalboje prieš sukurdami RTL stilių failą: jūsų tema jau gali būti pritaikyta RTL.
Kai įjungsite parinktį „%generate_rtl_label%“, bet kuris jau prie jūsų temos pridėtas RTL failas gali būti ištrintas sukuriant naują stilių failą.',
    'Browse your computer files and select the Zip file for your new theme.' => 'Pasirinkite naujos temos Zip failą iš savo kompiuterio.',
    'Indicate the complete URL to an online Zip file that contains your new theme. For instance, "http://example.com/files/theme.zip".' => 'Nurodykite pilną URL į įkeltą Zip failą, kuriame yra temos failai. Pvz. "http://example.com/files/theme.zip".',
    'This selector lists the Zip files that you uploaded in the \'/themes\' folder.' => 'Ši parinktis rodo sąrašą Zip failų, kuriuos įkėlėte į \'/themes\' aplanką.',
    'You must select a shop from the above list if you wish to choose a theme.' => 'Privalote pasirinkti parduotuvę iš aukščiau esančio sąrašo, kuriai norėsite parinkti temą.',
    'You are editing this page for a specific shop or group. Click "Yes" to check all fields, "No" to uncheck all.' => 'Jūs redaguojate šį puslapį konkrečiai parduotuvei ar grupei. Paspauskite "Taip", norėdami pažymėti visus laukus, "Ne" - norėdami nužymėti viską.',
    'If you check a field, change its value, and save, the multistore behavior will not apply to this shop (or group), for this particular parameter.' => 'Jei pažymėsite lauką, pakeisite reikšmę ir išsaugosite, multi parduotuvių elgsena nebus pritaikyta šiai parduotuvei (arba grupei), šiam konkrečiam parametrui.',
    'You are editing this page for a specific shop or group. Click "%yes_label%" to check all fields, "%no_label%" to uncheck all.' => 'Jūs redaguojate šį puslapį konkrečiai parduotuvei ar grupei. Paspauskite „%yes_label%“, norėdami pažymėti visus laukus, „%no_label%“ – norėdami nužymėti viską.',
  ),
  'AdminDesignNotification' => 
  array (
    'Your page will be saved as a draft' => 'Jūsų puslapis bus išsaugotas kaip juodraštis',
    'You can choose to keep your images stored in the previous system. There\'s nothing wrong with that.' => 'Jūs galite toliau naudoti savo ankstesniąją sitemą. Tai neturės jokios įtakos.',
    'You can also decide to move your images to the new storage system. In this case, click on the "Move images" button below. Please be patient. This can take several minutes.' => 'Taip pat jūs galite nuspręsti perkelti paveiksliukus į naują saugojimo sistemą. Tokiu atveju, paspauskite ant "Perkelti paveiksliukus" mygtuko esančio žemiau. Būkite kantrūs. Tai gali užimti keletą minučių.',
    'After moving all of your product images, set the "Use the legacy image filesystem" option above to "No" for best performance.' => 'Geriausiam našumo rezultatui pasiekti, po paveiksliukų perkėlimo nuostatą "Naudoti senąją paveiksliukų sistemą" nustatytikite į būseną "Ne".',
    'If you want to order/move the following data, please select a shop from the shop list.' => 'Jei norite rikiuoti/perkelti šiuos duomenis, pasirinkite parduotuvę iš parduotuvių sąrašo.',
    'Current theme is unavailable. Please check your theme\'s directory name ("%s") and permissions.' => 'Dabartinė tema nepasiekiama. Patikrinkite savo temos pavadinimą ("%s") ir leidimus.',
    'No items found' => 'Nieko nerasta',
    'Duplicate images were found when moving the product images. This is likely caused by unused demonstration images. Please make sure that the folder %folder% only contains demonstration images, and then delete it.' => 'Bandant perkelti prekės paveiksliukus, rasti pasikartojantys paveiksliukai. Tai dažniausiai atsitinka dėl nenaudojamų demonstracinių paveiksliukų. Įsitikinkite, kad aplanke %folder% yra tik demonstraciniai paveiksliukai ir tuomet jį ištrinkite.',
    'Incorrect value for the selected JPEG image compression.' => 'Pasirinkta klaidinga reikšmė JPEG nuotraukų suglaudinimui.',
    'Incorrect value for the selected PNG image compression.' => 'Pasirinkta klaidinga reikšmė PNG nuotraukų suglaudinimui.',
    'Source file does not exist or is empty (%filepath%)' => 'Šaltinio failas neegzistuoja arba yra tuščias (%filepath%)',
    'Failed to resize image file (%filepath%)' => 'Nepavyko sumažinti nuotraukos failo (%filepath%)',
    'Failed to resize image file to high resolution (%filepath%)' => 'Nepavyko pakeisti paveiksliuko išmatavimų iki aukštos rezoliucijos (%filepath%)',
    'Original image is corrupt (%filename%) for product ID %id% or bad permission on folder.' => 'Prekės ID %id% originalus paveiksliukas yra sugadintas (%filename%) arba blogi leidimai folderyje.',
    'Original image is missing or empty (%filename%) for product ID %id%' => 'Prekės ID %id% originalus paveiksliukas yra nerastas arba tuščia (%filename%)',
    'Cannot write images for this type: %1$s. Please check the %2$s folder\'s writing permissions.' => 'Nepavyko įrašyti nuotraukų pagal šį tipą: %1$s. Patikrinkite ar yra suteiktos įrašymo teisės %2$s katalogui.',
    'Only part of the images have been regenerated. The server timed out before finishing.' => 'Tik dalis paveiksliukų buvo sugeneruota iš naujo. Baigėsi užduoties vykdymo laikas serveryje.',
    'Server timed out. The watermark may not have been applied to all images.' => 'Serverio laukimo laikas baigėsi, vandenženklis nėra pritaikytas visiems vaizdams.',
    'Cannot write "No picture" image to %s images folder. Please check the folder\'s writing permissions.' => 'Negalyma rašyti "No picture" paveiksliuko į %s paveiksliukų katalogą. Patikrinkite katalogo rašymo teises.',
    'Error: Your server configuration is not compatible with the new image system. No images were moved.' => 'Klaida: jūsų serverio konfigūracija nesuderinama su naująja paveiksliukų saugojimo sistema. Paveiksliukai nebuvo perkelti.',
    'Not all images have been moved. The server timed out before finishing. Click on "Move images" again to resume the moving process.' => 'Ne visi paveiksliukai buvo perkelti. Užduoties vykdymo laikas serveryje baigėsi. Norėdami pratęsti perkėlimo procesą, paspauskite "Perkelti paveiksliukus" iš naujo.',
    'Error: Some -- or all -- images cannot be moved.' => 'Klaida: vienas – ar – daugiau paveiksliukų negali būti perkelti.',
    'After modification, do not forget to regenerate thumbnails' => 'Po pakeitimų nepamiškite iš naujo sukurti miniatiūrų',
    'Not all images have been moved. The server timed out before finishing. Click on "%move_images_label%" again to resume the moving process.' => 'Ne visi paveiksliukai buvo perkelti. Užduoties vykdymo laikas serveryje baigėsi. Norėdami pratęsti perkėlimo procesą, paspauskite „%move_images_label%“ iš naujo.',
    'The uploaded file is too large.' => 'Įkeltas failas per didelis.',
    'Failed to move uploaded file.' => 'Neįmanoma perkelti įkeltų failų.',
    'This theme is not valid for PrestaShop 1.7' => 'Ši tema nepalaiko PrestaShop 1.7',
    'An error occurred. The information "%s" is missing.' => 'Įvyko klaida. Informacija "%s" yra trūkstama.',
    'An error occurred. The template "%s" is missing.' => 'Įvyko klaida. Šablonas "%s" yra trūkstamas.',
    'An error occurred while uploading the favicon: cannot copy file "%s" to folder "%s".' => 'Įvyko klaida bandant įkelti favicon paveiksliuką: nepavyko nukopijuoti "%s" į aplanką "%s".',
    'Your theme has been correctly exported: %path%' => 'Jūsų tema sėkmingai eksportuota: %path%',
    'The page Category cannot be moved here.' => 'Kategorija negali būti perkelta čia.',
    'Your RTL stylesheets has been generated successfully' => 'Jūsų RTL stilių lentelės sėkmingai sugeneruotos',
    'Your theme has been correctly reset to its default settings. You may want to regenerate your images. See the Improve > Design > Images Settings screen for the \'Regenerate thumbnails\' button.' => 'Jūsų tema buvo tinkamai atstatyta pagal numatytuosius nustatymus. Galbūt norėsite atkurti savo vaizdus. Eikite "Tobulinti"> "Dizainas"> "Vaizdų nustatymai" r spauskite mygtuką "Atkurti miniatiūras".',
    'There is already a theme %theme_name% in your themes folder. Remove it if you want to continue.' => 'Jūsų temų aplanke jau yra %theme_name% tema. Pašalinkite ją, jei norite tęsti.',
    'Failed to delete theme. Make sure you have permissions and theme is not used.' => 'Nepavyko ištrinti temos. Įsitikinkite, ar turite leidimą ir ar tema nėra naudojama.',
    'Cannot adapt theme to RTL languages.' => 'Negalima pritaikyti temos prie RTL kalbų.',
    'Your theme has been correctly reset to its default settings. You may want to regenerate your images. See the Improve > Design > Images Settings screen for the \'%regenerate_label%\' button.' => 'Jūsų tema buvo tinkamai atstatyta pagal numatytuosius nustatymus. Galbūt norėsite atkurti savo vaizdus. Eikite „Pritaikymai“ > „Išvaizda“ > „Paveiksliukų nustatymai“ ir spauskite mygtuką „%regenerate_label%“.',
    'This name already exists.' => 'Vardas jau egzistuoja.',
    'Invalid file format.' => 'Neteisingas failo formatas.',
    'Warning: if no email logo is available, the main logo will be used instead.' => 'Įspėjimas: neradus/nenurodžius el. laiškui skirto logotipo bus naudojamas pagrindinis logotipas.',
  ),
