    'Your online store needs to have a proper carrier registered in PrestaShop as soon as you start shipping your products. This means sending yours parcels using your local postal service, or having a contract with a private carrier which in turn will ship your parcels to your customers. In order to have PrestaShop suggest the most adequate carrier to your customers during their order checkout process, you need to register all the carriers with which you have chosen to work.' => 'Jūsų el. parduotuvė privalo turėti teisingą užregistruotą kurjerį PrestaShop sistemoje, kai jūs pradedate siųsti prekes pirkėjams. Tai reiškia siuntimą per vietinį pašto servisą arba kontraktą su privačiu kurjeriu, kuris pats pristatys prekes jūsų klientams. Tam, kad PrestaShop sistema galėtų pasiūlyti labiausiai tinkančius kurjerius Jūsų klientams pirkimo procese, Jums reikia įvesti visus kurjerius, su kuriais jūs pasirinkote dirbti.',
    'PrestaShop comes with a number of carrier modules that you can activate. You can also buy carrier modules on the PrestaShop Addons marketplace. Recommended modules are listed below: install the module that matches your carrier, and configure it!' => 'PrestaShop sistemoje jau iškart būna keli kurjerių moduliai, kuriuos galite aktyvuoti. Taip pat galite pirkti kurjerių modulius PrestaShop Addons svetainėje. Rekomenduojami moduliai yra surašyti žemiau: įdiekite labiausiai tinkantį modulį ir sukonfiguruokite jį!',
    'If there is no existing module for your carrier, then you can register that carrier by hand using the information that it can provide you: shipping rates, regional zones, size and weight limits, etc. Click on the "Add new carrier" button below to open the Carrier Wizard, which will help you register a new carrier in a few steps.' => 'Jei nėra jokio egzistuojančio modulio jūsų kurjeriui, tuomet galite įvesti kurjerį rankiniu būdu su informacija, kurią tas kurjeris suteiks: pristatymo įkainiai, regionai, svorio limitai. Spauskite mygtuką "Pridėti naują kurjerį", kuris padės Jums įvesti naują kurjerį keliais žingsniais.',
    'Note: DO NOT register a new carrier if there already exists a module for it! Using a module will be much faster and more accurate!' => 'Pastaba: Neįvedinėkite naujo kurjerio, jei tam jau yra sukurtas specialus modulis. Naudoti modulį - bus žymiai greičiau ir tikslingiau!',
    'The carrier\'s name will be displayed during checkout.' => 'Kurjerio pavadinimas bus rodomas užsakymo metu.',
    'The delivery time will be displayed during checkout.' => 'Pristatymo laikas bus rodomas užsakymo metu.',
    'Delivery tracking URL: Type \'@\' where the tracking number should appear. It will be automatically replaced by the tracking number.' => 'Siuntos sekimo nuorodos klientui generavimui: įrašykite \'@\' toje vietoje, kur turi atsirasti siuntos sekimo numeris. T.y. PrestaShop automatiškai simbolį \'@\' pakeis užsakyme nurodytu.',
    'For example: \'http://example.com/track.php?num=@\' with \'@\' where the tracking number should appear.' => 'Pavyzdžiui: \'http://example.com/track.php?num=@\', kur vietoj @ simbolio įrašomas siuntos sekimo kodas.',
    'Include the handling costs (as set in Shipping > Preferences) in the final carrier price.' => 'Įtraukti tvarkymo išlaidas (kaip nustatyta Pristatymas > Nustatymai) galutinėje kurjerio kainoje.',
    'Out-of-range behavior occurs when no defined range matches the customer\'s cart (e.g. when the weight of the cart is greater than the highest weight limit defined by the weight ranges).' => 'Veiksmas, kai reikšmė yra už maks. intervalo ribų įvyksta tada, kad reikšmė "neįkrenta" į nei vieną apibrėžtą intervalą (pvz. kai kliento krepšelio prekių svoris yra didesnis nei maks. nurodyta svorio intervalo reikšmė).',
    'Maximum width managed by this carrier. Set the value to "0", or leave this field blank to ignore.' => 'Maksimalus plotis, kurį gali pristatyti šis kurjeris. Norėdami ignoruoti, nustatykite reikšmę "0" arba palikite lauką tuščią.',
    'The value must be an integer.' => 'Reikšmė turi būti sveikas skaičius.',
    'Maximum height managed by this carrier. Set the value to "0", or leave this field blank to ignore.' => 'Maksimalus aukštis, kurį gali pristatyti šis kurjeris. Norėdami ignoruoti, nustatykite reikšmę "0" arba palikite lauką tuščią.',
    'Maximum depth managed by this carrier. Set the value to "0", or leave this field blank to ignore.' => 'Maksimalus pakuotės ilgis, galimas šiam kurjeriui. Nustatykite reikšmę "0" arba palikite šį lauką tuščią, jei apribojimų nėra.',
    'Maximum weight managed by this carrier. Set the value to "0", or leave this field blank to ignore.' => 'Maksimalus svoris, kurį gali pristatyti šis kurjeris. Norėdami ignoruoti, nustatykite reikšmę "0" arba palikite lauką tuščią.',
    'Allowed characters: letters, spaces and "%special_chars%".' => 'Leidžiami simboliai: raidės, tarpai ir "%special_chars%".',
    'For in-store pickup, enter 0 to replace the carrier name with your shop name.' => 'Jei nustatyta reikšmė 0, kurjerio pavadinimas bus pakeistas parduotuvės pavadinimu.',
    'Enter "0" for a longest shipping delay, or "9" for the shortest shipping delay.' => 'Įveskite "0" ilgiausiam pristatymo užlaikymui arba "9" trumpiausiam pristatymo užlaikymui.',
    'Mark the groups that are allowed access to this carrier.' => 'Pažymėkite visas grupes, kurioms norite priskirti šį kurjerį.',
    'Enable the carrier in the front office.' => 'Įjungti šį kurjerį parduotuvėje.',
    'Carrier name displayed during checkout' => 'Pirkimo metu rodomas kurjerio pavadinimas',
    'Upload a logo from your computer.' => 'Įkelkite logotipą iš savo kompiuterio',
    'or' => 'arba',
    'Estimated delivery time will be displayed during checkout.' => 'Numatomas prekių pristatymo laikas, rodomas pirkimo metu.',
    'Delivery tracking URL: Type \'@\' where the tracking number should appear. It will then be automatically replaced by the tracking number.' => 'Siuntoms sekimo nuoroda; sekimo numeris bus rodomas ten, kur įvesite simbolį \'@\'.',
    'The zones in which this carrier will be used.' => 'Zonos, kuriose bus naudojamas kurjeris.',
    'Group access' => 'Grupės teisės:',
    'Apply both regular shipping cost and product-specific shipping costs.' => 'Įveskite tiek įprastą pristatymo kainą, tiek specifinę prekės pristatymo kainą. ',
