    'Maximum height managed by this carrier. Set the value to "0," or leave this field blank to ignore.' => 'Maksimalus paketo aukštis, galimas šiam kurjeriui. Nustatykite reikšmę "0" arba palikite šį lauką tuščią, jei apribojimų nėra.',
    'Maximum width managed by this carrier. Set the value to "0," or leave this field blank to ignore.' => 'Maksimalus pakuotės plotis, galimas šiam kurjeriui. Nustatykite reikšmę "0" arba palikite šį lauką tuščią, jei apribojimų nėra.',
