    'Total customer accounts:' => 'Viso pirkėjų paskyrų:',
    'Number of customer accounts created' => 'Sukurta pirkėjų paskyrų',
    'The total number of accounts created is not in itself important information. However, it is beneficial to analyze the number created over time. This will indicate whether or not things are on the right track. You feel me?' => 'Sukurtų paskyrų skaičius pats savaime nėra svarbi informacija. Tačiau yra naudinga panagrinėti sukurtų paskyrų skaičių per laiko tarpą. Tai parodys ar reikalai eina teisinga linkme. Ar ne?',
    'How to act on the registrations\' evolution?' => 'Ką daryti su registracijų evoliucija?',
    'If you let your shop run without changing anything, the number of customer registrations should stay stable or show a slight decline.' => 'Jei leisite savo parduotuvei veikti nieko nekeičiant, klientų registracijos skaičius turėtų likti stabilus ar šiek tiek mažesnis.',
    'A significant increase or decrease in customer registration shows that there has probably been a change to your shop. With that in mind, we suggest that you identify the cause, correct the issue and get back in the business of making money!' => 'Didelis klientų registracijų augimas ar kritimas rodo, kad Jūsų parduotuvėje tikriausiai buvo kažkoks pokytis. Turint tai omenyje, mes rekomenduojame identifikuoti priežastį, ištaisyti problemą ir grįžti į verslą užsidirbti pinigų!',
    'Here is a summary of what may affect the creation of customer accounts:' => 'Tai yra sąvadas priežasčių, kurios galėjo įtakoti pirkėjų paskyrų kūrimą:',
    'An advertising campaign can attract an increased number of visitors to your online store. This will likely be followed by an increase in customer accounts and profit margins, which will depend on customer "quality." Well-targeted advertising is typically more effective than large-scale advertising... and it\'s cheaper too!' => 'Reklamos kampanija gali pritraukti didesnį lankytojų skaičių į Jūsų parduotuvę. Tai greičiausiai bus įtakojama klientų paskyrų ir pelno maržos padidėjimo, kurie priklauso nuo klientų "kokybės". Kontekstinės reklamos paprastai yra efektyvesnės nei didelio mąsto reklamos...ir tai yra pigiau!',
    'Specials, sales, promotions and/or contests typically demand a shoppers\' attentions. Offering such things will not only keep your business lively, it will also increase traffic, build customer loyalty and genuinely change your current e-commerce philosophy.' => 'Spec. pasiūlymai, išpardavimai, akcijos ir/ar konkursai paprastai reikalauja pirkėjų dėmesio. Siūlant tokius dalykus ne tik išlaikomas verslas "gyvas", bet ir padidinama prekyba, kuriamas klientų lojalumą ir iš esmės pakeičiama Jūsų dabartinę e-komercijos filosofiją.',
    'Design and user-friendliness are more important than ever in the world of online sales. An ill-chosen or hard-to-follow graphical theme can keep shoppers at bay. This means that you should aspire to find the right balance between beauty and functionality for your online store.' => 'Išvaizda ir draugiškumas vartotojui interneto prekybos pasaulyje svarbus kaip niekada. Blogai parinkta ar sunkiai sekama grafinė išvaizda gali atgrasinti pirkėjus. Tai reiškia, kad savo parduotuvėje turėtumėte ieškoti balanso tarp grožio ir funkcionalumo.',
    'CSV Export' => 'CSV eksportas',
  ),
