    'If you want to be able to fully use the AdminModules panel and have free modules available, you should enable the following configuration on your server:' => 'Jei norite pilnai išnaudoti AdminModules panelės galimybės ir turėti nemokamus modulius, savo serveryje turite įjungti šias konfigūracijas:',
