    'Do you want to install this module that could not be verified by PrestaShop?' => 'Ar norite įdiegti šį modulį, kurio nepavyko patvirtinti PrestaShop servisui?',
    'Since you may not have downloaded this module from PrestaShop Addons, we cannot assert that the module is not adding some undisclosed functionalities. We advise you to install it only if you trust the source of the content.' => 'Kadangi šį modulį tikriausiai parsisiuntėte ne iš PrestaShop Addons, mes negalime užtikrinti, kad modulis nepridės jokių nepaskelbtų funkcijų. Mes patariame jums įdiegti šį modulį tik tokiu atveju, jei pasitikite modulio kūrėjais arba pardavėjais.',
    'What\'s the risk?' => 'Kokia yra rizika?',
    'Am I at Risk?' => 'Ar aš esu rizikoje?',
    'A module that hasn\'t been verified may be dangerous and could add hidden functionalities like backdoors, ads, hidden links, spam, etc. Don’t worry, this alert is simply a warning.' => 'Modulis, kuris nėra patvirtintas, gali būti pavojingas ir gali pridėti nuslėptų funkcijų: reklamų, prisijungimų, slaptų nuorodų, šlamšto ir kt. Šis pranešimas yra tik įspėjimas apie tai, kas gali būti.',
    'PrestaShop, being an open-source software, has an awesome community with a long history of developing and sharing high quality modules. Before installing this module, making sure its author is a known community member is always a good idea (by checking [1]our forum[/1] for instance).' => 'PrestaShop yra atvirojo kodo platforma, kuri turi nuostabią bendruomenę, ilgą vystymo istoriją ir dalinimąsi aukštos kokybės moduliais. Prieš įdiegiant šį modulį, įsitikinkite, kad modulio autorius yra gerai žinomas bendruomenės narys - pavyzdžiui, galite pasitikrinti mūsų [1]forumuose[/1].',
    'If you trust or find the author of this module to be an active community member, you can proceed with the installation.' => 'Jei pasitikite modulio kūrėju arba įsitikinate, kad jo autorius yra aktyvus bendruomenės narys, tęskite įdiegimą.',
    'Otherwise you can look for similar modules on the official marketplace. [1]Click here to browse PrestaShop Addons[/1].' => 'Kitu atveju, jūs galite ieškoti panašių modulių oficialioje modulių el. parduotuvėje. [1]Spauskite čia, jei norite eiti į PrestaShop Addons[/1].',
